interface TicTacToeInterface {
    TicTacToe: TypeTicTacToe[]
}


export type TypeTicTacToe = {
    id: number,
    visible: boolean,
    circle: boolean,
}



enum TicTacToeActionsTypes {
    REMOVE_CROSS = "REMOVE_CROSS",
    REMOVE_CIRCLE = "REMOVE_CIRCLE",
}

interface RemoveCross {
    type: TicTacToeActionsTypes.REMOVE_CROSS,
    payload: TypeTicTacToe,
}
interface RemoveCircle {
    type: TicTacToeActionsTypes.REMOVE_CIRCLE,
    payload: TypeTicTacToe
}

type TicTacToeActions = RemoveCross | RemoveCircle


const defaultState: TicTacToeInterface = {
    TicTacToe: [
        {id: 1, visible: false, icon: boolean},
        {id: 2, visible: false, icon: boolean},
        {id: 3, visible: false, icon: boolean},
        {id: 4, visible: false, icon: boolean},
        {id: 5, visible: false, icon: boolean},
        {id: 6, visible: false, icon: boolean},
        {id: 7, visible: false, icon: boolean},
        {id: 8, visible: false, icon: boolean},
        {id: 9, visible: false, icon: boolean},
    ]
}


export const Reducer = (state = defaultState, action: TicTacToeActions): TicTacToeInterface => {
    switch(action.type) {
        case TicTacToeActionsTypes.REMOVE_CROSS:
            return{...state}
        case TicTacToeActionsTypes.REMOVE_CIRCLE:
            return{...state}
        default:
            return{ ...state}
    }
}

export const removeCrossAction = (payload: TypeTicTacToe) => ({type: TicTacToeActionsTypes.REMOVE_CROSS, payload})
export const RemoveCircleAction = (payload: TypeTicTacToe) => ({type: TicTacToeActionsTypes.REMOVE_CIRCLE, payload})
